import Home from "./pages/home/Home";
import Characters from "./pages/Characters/Characters";
import Serials from "./pages/Serials/Serials";  
import Groups from "./pages/Groups/Groups";
import Fans from "./pages/Fans/Fans";
import { Children } from "react";

let routers = [
  { path: "/", element: <Home /> },
  {
    path: "/Characters/*", element: <Characters />, Children:
      [
      {path: ""}
    ]
  },
  { path: "/Serials", element: <Serials /> },
  { path: "/Groups/:groupId", element: <Groups /> },
  { path: "/Groups", element: <Groups /> },
  { path: "/Fans", element: <Fans /> },
];

export default routers;
